import React from 'react';

function Navigation({ activeSection, setActiveSection }) {
  return (
    <div className="header">
      <nav className="tab-navigation">
        <ul>
          <li><a href="#" data-section="projects" className={activeSection === 'projects' ? 'active' : ''} onClick={() => setActiveSection('projects')}>Projects</a></li>
          <li><a href="#" data-section="contact" className={activeSection === 'contact' ? 'active' : ''} onClick={() => setActiveSection('contact')}>Contact</a></li>
          <li><a href="#" data-section="blog" className={activeSection === 'blog' ? 'active' : ''} onClick={() => setActiveSection('blog')}>Blog</a></li>
        </ul>
      </nav>
    </div>
  );
}

export default Navigation;
